import React, { Component } from 'react';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import axios from 'axios';

const url_local = 'http://localhost:8000/';
const url_remote = 'https://www.test.pressstart.co/dev/whitelabel/api/';
const url_default = url_local;

const token = window.localStorage.getItem('token');

class Exportar extends Component {

    send = () => {
        axios.get(url_default + 'store_report')
        .then(function(res){
            if(res.status == 200){
                axios.post(url_default + 'contactar')
                .then(function(res){
                    if(res.status === 200){
                        alert('Se envío un correo al usuario');
                    }
                })
            }
        });
    }
    render() {

        return (

            <div id="index-modulos" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <a href='http://localhost:8000/exportar'>Exportar</a>
                            <a href='#' onClick={this.send}>  Enviar reporte</a>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

export default Exportar;
